export default function ProductPage() {
    const {id} = useParams();
    const param = id;
    let dataP;
    for (let i = 0; i < data.length; i+=1) {
      const d1 = data[i].pages;
      for (let j = 0; j < d1.length; j+=1) {
        const d2 = d1[j];
        if (d2.nameLinkProduct == param) {
          dataP = d2;
          console.log(d2);
        }
      }
    }
    console.log(param, dataP);
  return (
    <main className={classes.catalog_product__container}>
        <h3 className={classes.catalog_product_title}>{dataP?.titleProduct}</h3>
        <div className={classes.catalog_product_wrapper}>
          <img src = {dataP?.imgProduct} alt = 'Погрузчик' className={classes.catalog_product_img}/>
