            <span className={classes.catalog_product__description_text}>{}</span>
            <span className={classes.catalog_product__description_text}>{}</span>
            <span className={classes.catalog_product__description_text}>{}</span>
            <span className={classes.catalog_product__description_text}>{}</span>
          </div>
        </div>
    </main>
  );
}
